import React, { Component } from 'react'
import GoogleMapReact from 'google-map-react'
import Marker from '../Users-list/Marker'

class UserMap extends Component {
    constructor(props) {
        super(props)
    }
    static defaultProps = {
        center: {
            lat: this.props.user.location.coordinates[0],
            lng: this.props.user.location.coordinates[1]
        },
        zoom: 16
    }

    render() {
        return (
            <div style={{ height: '100vh', width: '100%' }}>
                <GoogleMapReact
                    bootstrapURLKeys={{ key: 'AIzaSyBXpr3JxEaWQxjAaIJMhLXPIiUGBwA7XqY' }}
                    defaultCenter={{
                    lat: this.props.user.location.coordinates[0],
            lng: this.props.user.location.coordinates[1]
        }}
                    defaultZoom={this.props.zoom}
                >
                    <Marker lat={this.props.user.location.coordinates[0]} lng={this.props.user.location.coordinates[1]} text={this.props.user.name} />

                </GoogleMapReact>
            </div>
        );
    }
}

export default UserMap;
